var url = String.Empty;
var key = String.Empty;
var phone = Get<string>("Phone");
var activityId = Get<Guid>("Activity");
var orderId = Get<Guid>("Order");
var caseId = Get<Guid>("Case");
var text = Get<string>("Text");
var viberText = Get<string>("ViberText");
var tag = orderId != Guid.Empty ? "Заказ" : (caseId != Guid.Empty ? "Обращение" : String.Empty);
if(tag == String.Empty)
{
	tag = "СМС";
}
var date = DateTime.Now.AddMinutes(1).ToString("yyyy-MM-dd HH:mm:ss");
var username = String.Empty;
var password = String.Empty;
var callbackUrl = String.Empty;
var ttl = 0L;
try
{
    url = Convert.ToString(Terrasoft.Core.Configuration.SysSettings.GetValue(context.UserConnection, "UsrViberSmsApiUri"));
    username = Convert.ToString(Terrasoft.Core.Configuration.SysSettings.GetValue(context.UserConnection, "UsrViberSmsApiUserName"));
    password = Convert.ToString(Terrasoft.Core.Configuration.SysSettings.GetValue(context.UserConnection, "UsrViberSmsApiUserPassword"));
    callbackUrl = Convert.ToString(Terrasoft.Core.Configuration.SysSettings.GetValue(context.UserConnection, "UsrViberSmsApiCallbackUrl"));
    ttl = Convert.ToInt64(Terrasoft.Core.Configuration.SysSettings.GetValue(context.UserConnection, "UsrViberSmsApiTTL"));
}
catch (Exception ex)
{
	throw new Exception("SysSettings UsrViberSmsApiUri and UsrViberSmsApiKey have not been initialized");
}
var svcCredentials = Convert.ToBase64String(ASCIIEncoding.ASCII.GetBytes(username + ":" + password));
var httpWebRequest = (HttpWebRequest)WebRequest.Create(url);
httpWebRequest.ContentType = "application/json";
httpWebRequest.Method = "POST";
httpWebRequest.Headers.Add("Authorization", "Basic " + svcCredentials);
using (var streamWriter = new StreamWriter(httpWebRequest.GetRequestStream()))
{
    string json = JsonConvert.SerializeObject(new
    {
    	phone_number = phone,
    	extra_id = activityId.ToString(),
    	callback_url = callbackUrl,
    	start_time = date,
    	tag = tag,
    	is_promotional = false,
    	channels = new string[] {
    		"viber",
    		"sms"
    	},
    	channel_options = new {
    		sms = new {
    			text = text,
    			alpha_name = "EVA",
    			ttl = ttl
    		},
    		viber = new {
    			text = String.IsNullOrEmpty(viberText) == true ? text : viberText,
    			ttl = ttl
    		}
    	}
    }).ToString();
    streamWriter.Write(json);
    streamWriter.Flush();
    streamWriter.Close();
    Logger.Log("SEND_SMS", context.UserConnection, json);
}
try
{
	var httpResponse = (HttpWebResponse)httpWebRequest.GetResponse();
	using (var streamReader = new StreamReader(httpResponse.GetResponseStream()))
	{
		var result = streamReader.ReadToEnd();
		var response = JsonConvert.DeserializeObject<Terrasoft.Configuration.ViberSms.Response>(result.ToString());
	}
}
catch(WebException ex)
{
	if(ex.Response == null)
	{
		Set("UsrExceptionText", ex.Message);
		return true;
	}
	using (var stream = ex.Response.GetResponseStream())
    using (var reader = new StreamReader(stream))
    {
        Set("UsrExceptionText", reader.ReadToEnd());
    }
}
return true;
